import styled from 'styled-components';

export const SvgWrapper = styled.div`
	aspect-ratio: 960/300;
	width: 100%;
`;
export const Waves = styled.svg`
	width: 100%;
	display: block;

	.rect {
		fill: grey;
		width: 100%;
		height: 100%;
		color: white;
	}
`;
